using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class GeneralEarthquakeModel : Notifier	{		public GeneralEarthquakeModel()		{					SeismicZone = "";			SeismicZoneFactor = "";			SiteCoefficient = "";			SOne = "";			SiteClass = "";			UseGroup = "";			ImportanceFactor = "";		}				private string _SeismicZone;		public string SeismicZone			{				get { return _SeismicZone; }				set				{					_SeismicZone = value;					OnPropertyChanged(nameof(SeismicZone));				}			}				private string _SeismicZoneFactor;		public string SeismicZoneFactor			{				get { return _SeismicZoneFactor; }				set				{					_SeismicZoneFactor = value;					OnPropertyChanged(nameof(SeismicZoneFactor));				}			}				private string _SiteCoefficient;		public string SiteCoefficient			{				get { return _SiteCoefficient; }				set				{					_SiteCoefficient = value;					OnPropertyChanged(nameof(SiteCoefficient));				}			}				private string _SOne;		public string SOne			{				get { return _SOne; }				set				{					_SOne = value;					OnPropertyChanged(nameof(SOne));				}			}				private string _SiteClass;		public string SiteClass			{				get { return _SiteClass; }				set				{					_SiteClass = value;					OnPropertyChanged(nameof(SiteClass));				}			}				private string _UseGroup;		public string UseGroup			{				get { return _UseGroup; }				set				{					_UseGroup = value;					OnPropertyChanged(nameof(UseGroup));				}			}				private string _ImportanceFactor;		public string ImportanceFactor			{				get { return _ImportanceFactor; }				set				{					_ImportanceFactor = value;					OnPropertyChanged(nameof(ImportanceFactor));				}			}			}}